import { Component } from "react";
import Product from "./Product";

class ProductList extends Component {
  state = {};

  render() {
    return (
      <div>
        <h1>Products</h1>
        <div className="product-list">
          {this.state.products.map((product) => (
            <Product product={product} />
          ))}
        </div>
      </div>
    );
  }
}
export default ProductList;
